import React from 'react';
import { useParams } from 'react-router-dom';
import './App.css'; // Ensure this path is correct and matches your folder structure
import './app-public.css'; // Public-specific CSS file

function Chatbot() {
  const { mysource } = useParams();

  return (
    <div className={`chatbot-container ${mysource === 'public' ? 'public-chatbot' : 'internal-chatbot'}`}>
      <iframe src={`/OAD?mysource=${mysource}`} />
    </div>
  );
}

export default Chatbot;
